import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, ReactiveFormsModule } from '@angular/forms';
import { CommonModule } from '@angular/common'; 

interface Usuarios {
  nombre: string;
  apellidoPaterno: string;
  apellidoMaterno: string;
  edad: number;
  sexo: string;
  signo: string;
  imagenSigno: string;
}

@Component({
  selector: 'app-zodiaco',
  standalone: true,
  imports: [ReactiveFormsModule, CommonModule],
  templateUrl: './zodiaco.component.html',
  styles: []
})
export default class ZodiacoComponent implements OnInit {
  formGroup!: FormGroup;
  resultado!: Usuarios;

  constructor(private fb: FormBuilder) {}

  ngOnInit(): void {
    this.formGroup = this.initForm();
  }

  initForm(): FormGroup {
    return this.fb.group({
      nombre: [''],
      apellidoPaterno: [''],
      apellidoMaterno: [''],
      dia: [''],
      mes: [''],
      anio: [''],
      sexo: ['']
    });
  }

  onSubmit(): void {
    const { nombre, apellidoPaterno, apellidoMaterno, dia, mes, anio, sexo } = this.formGroup.value;
    const edad = this.calcularEdad(dia, mes, anio);
    const signoChino = this.calcularSignoChino(anio);
    const imagenSignoChino = this.obtenerImagenSignoChino(signoChino);

    this.resultado = { nombre, apellidoPaterno, apellidoMaterno, edad, sexo, signo: signoChino, imagenSigno: imagenSignoChino };
    console.log(this.resultado);
  }

  obtenerSexoRepresentacion(sexo: string): string {
    return sexo === 'Femenino' ? 'Eres mujer' : 'Eres hombre';
  }

  calcularEdad(dia: number, mes: number, anio: number): number {
    const fechaNacimiento = new Date(anio, mes - 1, dia);
    const edadDifMs = Date.now() - fechaNacimiento.getTime();
    const edadFecha = new Date(edadDifMs);
    return Math.abs(edadFecha.getUTCFullYear() - 1970);
  }

  calcularSignoChino(anio: number): string {
    const signosChinos = [
      'Rata', 'Buey', 'Tigre', 'Conejo', 'Dragón', 'Serpiente', 
      'Caballo', 'Cabra', 'Mono', 'Gallo', 'Perro', 'Cerdo'
    ];
    const indice = (anio - 4) % 12; // El ciclo del zodiaco chino comienza en el año 4 A.C.
    return signosChinos[indice];
  }

  
  obtenerImagenSignoChino(signo: string): string {
    const imagenesSignosChinos: { [key: string]: string } = {
      'Rata': 'data:image/jpeg;base64,',
      'Buey': 'data:image/jpeg;base64,',
      'Tigre': 'data:image/jpeg;base64,',
      'Conejo': 'data:image/jpeg;base64,',
      'Dragón': 'data:image/jpeg;base64,',
      'Serpiente': 'data:image/jpeg;base64,',
      'Caballo': 'data:image/jpeg;base64,',
      'Cabra': 'data:image/jpeg;base64,',
      'Mono': 'data:image/jpeg;base64,',
      'Gallo': 'data:image/jpeg;base64,',
      'Perro': 'data:image/jpeg;base64,',
      'Cerdo': 'data:image/jpeg;base64,',
    };
    return imagenesSignosChinos[signo] || 'url-to-default-image.png';
  }
}
